import React from "react";
import FiveDays from "../components/fiveDays";
import { Col, Container, Row } from "react-bootstrap";
const Home = () => {
  for (let i = 0; i < 5; i++) {
    return (
      <Container>
        <FiveDays />
      </Container>
    );
  }
  return <Container></Container>;
};

export default Home;
